script: |
  super -f text -I q5316.spq | sort > q5316.out

inputs:
  - name: q5316.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NULL NOT BETWEEN - col1 AND NULL ) OR + 75 + - - 97 NOT BETWEEN + col1 * + col1 * 72 AND - - col1 / - col0;
  - name: tab2

outputs:
  - name: q5316.out
    data: |
      46	51	23
      64	77	40
      75	67	58
